import React from "react";

const Header = () => {
	return (
		<div className='header'>
			<div className='home-page'>Justin Cabrera</div>
			<div className='navigation'>
				<ul>
					<li>Home</li>
				</ul>
			</div>
		</div>
	);
};

export default Header;
